import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import AdminDashboard from './components/dashboard/AdminDashboard';
import ProtectedRoute from './components/ProtectedRoute';
import AddTutor from './components/dashboard/pages/AddTutor'; // Import AddTutor page
import ListCourses from './components/dashboard/pages/ListCourses'; // Import ListCourses page
import ListTutor from './components/dashboard/pages/ListTutor'; // Import ListTutors page

function App() {
  return (
    <Router>
      <Routes>
        {/* Login Route */}
        <Route path="/" element={<Login />} />

        {/* Fallback Route */}
        <Route path="*" element={<Login />} />

        {/* Protected Admin Dashboard Route */}
        <Route
          path="/dashboard/admin"
          element={
            <ProtectedRoute>
              <AdminDashboard />
            </ProtectedRoute>
          }
        />

        {/* Protected Routes for Admin Pages */}
        <Route
          path="/dashboard/admin/add-tutor"
          element={
            <ProtectedRoute>
              <AddTutor />
            </ProtectedRoute>
          }
        />
        <Route
          path="/dashboard/admin/list-courses"
          element={
            <ProtectedRoute>
              <ListCourses />
            </ProtectedRoute>
          }
        />
        <Route
          path="/dashboard/admin/list-tutors"
          element={
            <ProtectedRoute>
              <ListTutors />
            </ProtectedRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
